import { useState } from 'react'
import { StyledCollapsible } from '../style/collapsible.styled'

export const Collapsible = ({ label, children }) => {
	const [isOpen, setIsOpen] = useState(false)
	console.log(label)

	return (
		<StyledCollapsible onClick={() => setIsOpen(!isOpen)}>
			{isOpen}
			{label}
		</StyledCollapsible>
	)
}
